import React from 'react';
import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
  <>
    <ul>
      <li>
        <Link to="/portfolio" id='portfolio'>Check out my projects here!</Link>
      </li>
    </ul>
  </>
  );
};
